let now = new Date();
let h = now.getHours().toString().padStart(2, '0');
let m = now.getMinutes().toString().padStart(2, '0');
let s = now.getSeconds().toString().padStart(2, '0');

msg.timestamp = `${h}:${m}:${s}`;
msg.topic = "Potencia Reactiva";


// Creamos un objeto con los datos
let registro = {
    tiempo: msg.timestamp,
    potencia: msg.payload,
    tipo: msg.topic
};

// Obtenemos el array global si existe, si no, lo creamos
let historico = global.get("historico") || [];
historico.push(registro); // Agregamos nuevo dato
global.set("historico", historico); // Guardamos

return msg;

let historico = global.get("historico") || [];
if (historico.length === 0) {
    node.warn("No hay datos en el histórico");
    return null;
}

// Generar encabezado
let csv = "Tiempo,Potencia,Tipo\n";

// Agregar filas
historico.forEach(registro => {
    csv += `${registro.tiempo},${registro.potencia},${registro.tipo}\n`;
});

// Asignar contenido al msg.payload
msg.payload = csv;
msg.filename = "historico.csv";
return msg;

// fx_volt
let v = Number(msg.payload);          // convierte a número
v = Math.round(v * 100) / 100;        // 2 decimales

global.set('ITG_volt', v);            // guarda

// no hace falta enviar nada valle arriba
return msg;    // pasa al siguiente nodo tal cual

// volt
const v = global.get('ITG_volt');
if (v === undefined) return null;     // aún no hay dato

// ① BORRAR el topic que traiga el mensaje
delete msg.topic;                     // ← clave contra el error rojo

// ② Construir el array de comandos
msg.payload = [
    {
        command: "update_text",
        selector: "#ITG_volt_value tspan",   // ← apunta al tspan
        textContent: v.toFixed(2)            // 207.92, 208.33, etc.
    }
];

delete msg.topic;   // sigue siendo necesario para quitar el aviso rojo
return msg;

